<body>
  <div id='vueApp'>
    <div class='container'>
      <header class='header-section'>
        <h2>Auto Visitor</h2>
        <span class='text-muted'>Get more visitor for your web</span>
        <div class='row'>
          <div class='col-md-6'>
            <div class='card'>
              <div class='card-body'>
                <form v-on:submit.prevent='goJinx'>
                  <div class='form-group'>
                    <label class='label-control' for='inputUrl'>Input URL with HTTP://</label>
                    <input class='form-control' id='inputUrl' name='url' required='true' type='text'
                      v-model='target.url' />
                  </div>
                  <div class='row'>
                    <div class='col-md-6'>
                      <div class='form-group'>
                        <label class='label-control' for='inputTraffic'>Traffic / sec</label>
                        <input class='form-control' id='inputTraffic' name='traffic' required='true' type='number'
                          v-model='target.traffic' />
                      </div>
                    </div>
                    <div class='col-md-6'>
                      <div class='form-group'>
                        <label class='label-control' for='inputMsg'>Leave your message:</label>
                        <input class='form-control' id='inputMsg' name='message' required='true' type='text'
                          v-model='target.msg' />
                      </div>
                    </div>
                  </div>
                  <button class='btn btn-raised btn-primary' id='btn-send' type='submit'
                    v-if='status.isState == false'>Send Traffic <i class='fas fa-paper-plane'></i></button>
                  <a class='btn btn-danger' href='javascript:void(0)' id='btn-stop' v-else='' v-on:click='jinxStop'>Stop
                    <i class='fas fa-minus-square'></i></a>
                </form>
              </div>
            </div>
          </div>
          <div class='col-md-6'>
            <div class='card'>
              <div class='card-body'>
                <h3>Result</h3>
                <table class='table table-striped table-hover'>
                  <tr>
                    <td><b class='text-warning'>Requested</b></td>
                    <td>: <b>{{ status.requested }}</b></td>
                  </tr>
                  <tr>
                    <td><b class='text-success'>Success</b></td>
                    <td>: <b>{{ status.success }}</b></td>
                  </tr>
                  <tr>
                    <td><b class='text-danger'>Failed</b></td>
                    <td>: <b>{{ status.failed }}</b></td>
                  </tr>
                </table>
              </div>
            </div>
          </div>
        </div>
